import "./players1.css"

function PlayerInfo(props) {
  const player = props.player

  
  return (
  <div className='container'>
    <img src ={player.picture}  alt = {player.name}></img>
      <div className='stats'>
        <h3 id="name">Name: {player.name}</h3>
        <h3 id="rank">Rank: {player.rank}</h3>
        <h3 id="points">Points: {player.points}</h3>
        <h3 id="tournaments">Tournaments: {player.tournaments}</h3>
        <h3 id="records">Records:{player.record}</h3>
      </div>
  </div>

  
      
  );
}

export default PlayerInfo;
